import React, { useRef } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import ViewAnalysis from './ViewAnalysis'
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    width:'100%',
    marginBottom:20
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
}));

export default function DenseAppBar({t}) {
  const classes = useStyles();
  const r = useRef()
  const [anchorEl, setAnchorEl] = React.useState(null);
  const handleClick = () => {
    setAnchorEl(r);
  };
  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Toolbar variant="dense">
          <IconButton ref={r} onClick={handleClick} edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
            <MenuIcon  />
          </IconButton>
          <Typography variant="h6" color="inherit">
            {t}
          </Typography>
        </Toolbar>
      </AppBar>
      <ViewAnalysis an={anchorEl} set={setAnchorEl}/>
    </div>
  );
}
